window.bookSummaryJSON = "<p>Perry Palomino and Dex Foray.</p> <p>On their own, they're uniquely brilliant. Together, they're an unstoppable team.</p> <p>Until now.</p> <p>Because after everything the duo has encountered, they haven't come across an evil quite like this. An evil that has been years in the making, an evil that will stop at nothing until they, and everyone they care for, are destroyed.</p> <p>Dex and Perry's love has survived a multitude of sins.</p> <p>But can it survive the end?</p> <p>Contains mature themes.</p>"; 
